import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import withLayout from 'nextra-theme-docs'
import { withSSG } from 'nextra/ssg'
import layoutConfig from 'C:/Users/paul/Documents/Projects/eezyquote/react-google-places-autocomplete/docs/theme.config.js'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const MDXLayout = function NextraPage (props) {
    return withSSG(withLayout({
      filename: "C:/Users/paul/Documents/Projects/eezyquote/react-google-places-autocomplete/docs/pages/index.md",
      route: "/",
      meta: {"id":"basic-usage","title":"Basics","sidebar_label":"Basics"},
      pageMap: [{"name":"index","route":"\\","frontMatter":{"id":"basic-usage","title":"Basics","sidebar_label":"Basics"}},{"name":"meta.json","meta":{"index":"Getting Started"}}]
    }, layoutConfig))(props)
}
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...props} components={components} mdxType="MDXLayout">
    <h2>{`Install`}</h2>
    <pre><code {...{
        "className": "language-bash",
        "parentName": "pre"
      }}>{`npm install --save @eezyquote/react-google-places
`}</code></pre>
    <p>{`or`}</p>
    <pre><code {...{
        "parentName": "pre"
      }}>{`yarn add @eezyquote/react-google-places
`}</code></pre>
    <h2>{`Basic Usage`}</h2>
    <h3>{`Load Google Maps JavaScript API`}</h3>
    <p>{`First, generate an `}
      <inlineCode {...{
        "parentName": "p"
      }}>{`apiKey`}</inlineCode>
      {` in order to use it to load `}
      <a {...{
        "href": "https://developers.google.com/maps/documentation/javascript/",
        "parentName": "p"
      }}>{`Google Maps JavaScript API`}</a>
      {`. Then, use it to load it in your HTML file, adding a script tag:`}</p>
    <pre><code {...{
        "className": "language-html",
        "parentName": "pre"
      }}>{`<script src="https://maps.googleapis.com/maps/api/js?key=YOUR_GOOGLE_API_KEY&libraries=places" type="text/javascript" />
`}</code></pre>
    <p><strong {...{
        "parentName": "p"
      }}>{`Note:`}</strong>
      {` if you pass down the `}
      <inlineCode {...{
        "parentName": "p"
      }}>{`apiKey`}</inlineCode>
      {` prop to the component, you can skip loading the `}
      <a {...{
        "href": "https://developers.google.com/maps/documentation/javascript/",
        "parentName": "p"
      }}>{`Google Maps JavaScript API`}</a>
      {`, as the component will inject that script on the page.`}</p>
    <h3>{`Use the component`}</h3>
    <pre><code {...{
        "className": "language-js",
        "parentName": "pre"
      }}>{`import React from 'react';
import GooglePlacesAutocomplete from '@eezyquote/react-google-places';

const Component = () =>  <GooglePlacesAutocomplete />

export default Component;
`}</code></pre>

  </MDXLayout>;
}

